DROP TABLE `bwiki_schema`.`BeautyParlor`;

CREATE TABLE `bwiki_schema`.`BeautyParlor` (
	no int(10) unsigned NOT NULL AUTO_INCREMENT,
	name varchar(50),
	address varchar(150),
	email varchar(50),
	contact varchar(30),
	foot_falls int(5),
	rating varchar(1),
	remarks varchar(100),
	PRIMARY KEY (no)
);

































































































































